UPDATE etfs_ativos_reais 
    SET dividends_12m = CASE symbol
        WHEN 'QUVU' THEN 1.616 WHEN 'REVS' THEN 1.739 WHEN 'EMTY' THEN 0.682 WHEN 'EUSA' THEN 1.488 WHEN 'IOO' THEN 2.237 WHEN 'HYUP' THEN 1.06 WHEN 'DPST' THEN 1.794 WHEN 'GSST' THEN 0.7629999999999999 WHEN 'ISHG' THEN 4.295 WHEN 'PTBD' THEN 0.28900000000000003 WHEN 'XMMO' THEN 0.869 WHEN 'VMOT' THEN 1.823849 WHEN 'IYF' THEN 1.565 WHEN 'USHY' THEN 0.833 WHEN 'RDVY' THEN 0.912 WHEN 'UBT' THEN 0.7410000000000001 WHEN 'KBWR' THEN 1.603 WHEN 'VGFO' THEN 1.20088 WHEN 'JEPI' THEN 1.764 WHEN 'AMDY' THEN 1.29
    END,
    updatedat = NOW()
    WHERE symbol IN ('QUVU', 'REVS', 'EMTY', 'EUSA', 'IOO', 'HYUP', 'DPST', 'GSST', 'ISHG', 'PTBD', 'XMMO', 'VMOT', 'IYF', 'USHY', 'RDVY', 'UBT', 'KBWR', 'VGFO', 'JEPI', 'AMDY');